import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

export default function MainHeader({ title }) {
    return (
        <View style={styles.header}>
            <Text style={{...styles.header}}>{title}</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    header: {
        alignItems:"center",
        fontWeight:"bold",
        fontSize:20
    }
})
